"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 297px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This biopsy demonstrates the presence of eosinophils within the blood vessel wall of a patient with the Churg-Strauss syndrome. Although eosinophils are the hallmark of Churg-Strauss syndrome, this biopsy does not show fibrinoid necrosis of the blood vessel wall and, hence, is not diagnostic of vasculitis.",
