" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Overview of the approach to the adult survivor of classical Hodgkin lymphoma",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?35/34/36394/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/34/36394/contributors\">",
"     Andrea K Ng, MD, MPH",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/34/36394/contributors\">",
"     Ann S LaCasce, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?35/34/36394/contributors\">",
"     Section Editors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/34/36394/contributors\">",
"     Larissa Nekhlyudov, MD, MPH",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/34/36394/contributors\">",
"     Kenneth D Miller, MD",
"    </a>",
"    <br/>",
"   </div>",
